import logo from './logo.svg';
import { display } from '@mui/system';

//external lib
import ContentCopyIcon from '@mui/icons-material/ContentCopy';
import { CopyToClipboard } from 'react-copy-to-clipboard';

//import component
import BiodataAvatar from './component/biodata-avatar'
import BiodataBio from './component/biodata-bio';

// needed internal resource
import avatarImg from "./img/ava3.jpg";

const styleContact = {
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "center",
  gap: "10px",
  backgroundColor: "#333333ff", 
  height :"fit-content",
  width : "100%",
  color:"white"
};

const styleContainer = {
  paddingBottom: "100px"
}

const styleSection = {
  paddingBottom : "20px"
}

const styleButton = {
  display: "inline-block",
  cursor: "pointer"
}

const styleValue = {
  width: "300px"
}

function Contact() {

  return (
    <div style={styleContact}>

        <h1 style={{margin : "5px", paddingBottom:"50px", paddingTop: "100px"}}>Contact</h1>
        <div style={styleContainer}>
          <div style={styleSection}>
            <b>WhatsApp</b>
              <div style={styleValue}><p>+62 859 106 535 530</p></div>
              <div style={styleButton}>
                <CopyToClipboard text="+62859106535530">
                      <ContentCopyIcon fontSize='small'></ContentCopyIcon>
                </CopyToClipboard>
              </div>

            </div>
          <div style={styleSection}>
            <b>E-Mail</b>
            <p>alfianezaputra@gmail.com</p>
            <div style={styleButton}>
                <CopyToClipboard text="alfianezaputra@gmail.com">
                      <ContentCopyIcon fontSize='small'></ContentCopyIcon>
                </CopyToClipboard>
              </div>
          </div>
          <div style={styleSection}>
            <b>Github</b>
            <p>alfian-putra</p>
          </div>
          <div style={styleSection}>
            <b>Location</b>
            <p>Bale Asri, Pereng Dawe, Balecatur, Gamping, Sleman, D.I.Yogyakarta.</p>
          </div>
        </div>
    </div>
  );
}

export default Contact;
